import React, {Component} from 'react'

class IssueList extends Component {

    constructor(props){
        super(props);

        this.state = {
            issuedata:[],
        };
    }

    componentDidMount(){
        fetch('http://localhost:8080/issues')
        .then(response => response.json())
        .then((data) => {
            this.setState({issuedata:data})
        })
        .catch(console.log)
        
        
    }

    
    render(){
        return(
            <h3>this.state.issuedata</h3>
           
        )
    }
}

export default IssueList;
